lly. As they are double sided, the turquoise gemstone is also visible from the back, with only the sides being encrusted and giving 360ÃÂ° of sparkle.','https://www.sorujewellery.com/cdn/shop/files/Earring11_01_62bab918-05bb-49f3-8b8f-1276bf5c6894_3000x.jpg?v=1716560378','Turquoise Double Sided Earrings',4900000,'http://localhost:8080/api/v1/images/8934032382624',100,5688000,'S','2','SELL','earrings',5,2),(7,'http://localhost:8080/api/v1/images/10768','8933995107688','10768','Your new go to mini stud earrings with a pale turquoise centre for a hint of colour, set into vintage style textured 18k gold pated silver. Lightweight and easy to wear, this round stud earring is the epitome of chic.','https://www.sorujewellery.com/cdn/shop/files/Earring3_01_3000x.jpg?v=1716559851','Amalfi Earrings',4600000,'http://localhost:8080/api/v1/images/8933995107688',100,5321000,'S','2','SELL','earrings',4,2),(8,'http://localhost:8080/api/v1/images/26536','8936806265362','26536','Oval stud earrings featuring a pastel green shimmering cats eye gemstone surrounded by a mix of sparkling green and opal crystals set with a mosaic sun motif.','https://www.sorujewellery.com/cdn/shop/files/Earring14_01_9c960886-ca27-4661-8797-2c098ec2f63a_3000x.jpg?v=1716560688','Green Sun Stud Earrings',4280000,'http://localhost:8080/api/v1/images/8936806265362',100,4771000,'S','2','SELL','earrings',5,2),(9,'http://localhost:8080/api/v1/images/35313','8937545353136','35313','These beautifully detailed golden shell earrings are lightweight and moveable with 3 concave hand crafted shell shapes made from from 14k gold plated silver. ','https://www.sorujewellery.com/cdn/shop/files/Earring13_01_9df33925-4477-4fb4-9867-35c28ba34cba_3000x.jpg?v=1716560913','Pink Dot Stud Earrings',4280000,'http://localhost:8080/api/v1/images/8937545353136',100,4771000,'S','2','SELL','earrings',5,2),(10,'http://localhost:8080/api/v1/images/38099','8931035380992','38099','Chic oval shaped stud earrings featuring an iridescent majorca pearl gemstone surrounded by sparkling golden yellow and opal crystals set as a mosaic sun motif.','https://www.sorujewellery.com/cdn/shop/files/Earring15_01_26441f6b-08d4-493e-a001-282cd7777029_3000x.jpg?v=1716560965','Yellow Sun Stud Earrings',4280000,'http://localhost:8080/api/v1/images/8931035380992',100,4771000,'S','2','SELL','earrings',5,2),(11,'http://localhost:8080/api/v1/images/82013','8932546820137','82013','These beautifully detailed golden shell earrings are lightweight and moveable with 3 concave hand crafted shell shapes made from from 14k gold plated silver. ','https://www.sorujewellery.com/cdn/shop/files/Earring2_01_cc2b7f17-4c1c-41f6-89df-09752639ec3f_3000x.jpg?v=1719481049','Marino Earrings',6600000,'http://localhost:8080/api/v1/images/8932546820137',100,7157000,'M','2','SELL','earrings',9.4,2),(12,'http://localhost:8080/api/v1/images/19339','8934224193397','19339','Super chic and beautifully detailed large gold and pearl stud earrings featuring a textured wrapped golden edge around a round centre pearl. Made in small batches, by hand in Italy from 18K gold plated silver. ','https://www.sorujewellery.com/cdn/shop/files/Earring18_01_3000x.jpg?v=1716554851','Livia Earrings',7828000,'http://localhost:8080/api/v1/images/8934224193397',10,8441000,'M','2','SELL','earrings',7,2),(13,'http://localhost:8080/api/v1/images/42686','8932426426862','42686','The Constellation Stud Earrings are hand crafted 18k gold plated silver mini domes with sparkling clear crystals and etched textured surface to recreate the beauty of the night sky. ','https://www.sorujewellery.com/cdn/shop/files/Earring2_01_6320af80-6980-4a0a-8bd5-d24f0d51f51d_3000x.jpg?v=1716556590','Constellation Stud Earrings',5322000,'http://localhost:8080/api/v1/images/8932426426862',10,5872000,'S','2','SELL','earrings',4,2),(14,'http://localhost:8080/api/v1/images/23698','8936032236983','23698','Taking essence from our larger Giovanna Earrings, we created a mini hoop version as an everyday staple. Completely encrusted, by hand in Italy, with sparkling clear crystals they add a touch of glamour to your everyday look','https://www.sorujewellery.com/cdn/shop/files/Earring1_01_97603fa3-b536-43a2-8722-6d045ccf8705_3000x.jpg?v=1716556199','Mini Giovanna Hoop Earrings',4700000,'http://localhost:8080/api/v1/images/8936032236983',50,5322000,'S','2','SELL','earrings',3,2),(15,'http://localhost:8080/api/v1/images/41428','8935681414285','41428','Make a statement with these vintage inspired roman coin drop earrings with intricate rope boarder detailing. Crafted by hand in Italy using 18K gold plated silver.','https://www.sorujewellery.com/cdn/shop/files/Earring6_01_163af3ad-0d49-4a3d-b651-4ed1d5ceb955_3000x.jpg?v=1716560010','Medici Drop Earrings',8300000,'http://localhost:8080/api/v1/images/8935681414285',10,9542000,'M','2','SELL','earrings',9,2),(16,'http://localhost:8080/api/v1/images/15314','8938504153149','15314','Stunning large statement earrings featuring round baroque pearls set within a flower shaped casing of clear multi-faceted crystals, finished with teardrop shaped pearls handing from the flower and a textured decorative back. All made by hand in small batches.','https://www.sorujewellery.com/cdn/shop/files/Earring5_01_c627c972-6fe5-498f-87dd-42c0a0e254bf_3000x.jpg?v=1716560768','Baroque Pearl Flower Earrings',7204000,'http://localhost:8080/api/v1/images/8938504153149',100,8074000,'L','2','SELL','earrings',12,2),(17,'http://localhost:8080/api/v1/images/89424','8933216894243','89424','These stunning drop earrings are hand encrusted with sparkling crystals and mixed sized pearls. Lightweight and easy to wear yet eye catching and timelessly elegant.','https://www.sorujewellery.com/cdn/shop/files/Earring8_01_e5d7b98e-1949-4028-9399-8210e278b8d9_3000x.jpg?v=1716561196','Ravello Earrings',8500000,'http://localhost:8080/api/v1/images/8933216894243',50,9909000,'L','2','SELL','earrings',11,2),(18,'http://localhost:8080/api/v1/images/60567','8936032605673','60567','Shimmi